import React from 'react';
import { useNavigate } from 'react-router-dom';
import Button from '@mui/material/Button';
import '../SignUp/Signup.scss'; // Import the CSS file

const SignUpForm = () => {
  const navigate = useNavigate();

  return (
    <div className="Signup-container">
      <h1 className="Signup-title">Fundo</h1>
      <h2 className="Signup-subtitle">Create your Fundo Account</h2>

      <form className="Signup-form">
        <input type="text" placeholder="First Name*" required />
        <input type="text" placeholder="Last Name*" required />
        <input type="text" placeholder="Username*" required />
        <small>You can use letters, numbers & periods</small>
        <input type="password" placeholder="Password*" required />
        <small>Use 8 or more characters with a mix of letters, numbers & symbols</small>
        <input type="password" placeholder="Confirm*" required />

        <Button variant="contained">Register</Button>
        </form>

      <p className="Signup-signin-prompt">
      <a href="/signin" onClick={(event) => { event.preventDefault(); navigate('/signin'); }}>Sign in instead</a>
      </p>

      <div className="footer">
        <select className="language-selector">
          <option>English (United States)</option>
        </select>
      </div>

      <div className="info-text">
        <p>One account. All of Fundo working for you.</p>
      </div>
    </div>
  );
};

export default SignUpForm;
